le Groupe propose des  
					solutions autour des thèmes suivants :  
					- l’émission et/ou le traitement de coupons de réduction  
					véhiculé sur un support physique (sur un paquet, dans un  
					carnet de coupons, en caisse, etc.) ou dématérialisé  
					(téléphone mobile, site e-commerce, carte de fidélité, etc.) ;  
					- la monétisation de contenu (ensemble des pratiques  
					permettant de rémunérer l’audience d’un site internet, d’un  
					média, d’une application mobile ou encore d’une antenne  
					dans le cas où l’accès à l’information se fait de manière  
					libre et gratuite) ;  
					- conseil et création sur des enjeux de communication &  
					marketing ;  
					- gestion d’espaces publicitaires ;  
					- développements informatiques ;  
					- etc.
